      "text": "16. Bey Hrn. Rudolf Ramsperger an der Hufs gass ist etwa guter Holländer-Salat in Bleyern und Pfund-Büchsen à 10 Bazen, wie auch guter St. Vincer à 8 Bz. zu haben."
