    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "19. Bey Hrn. Durstbard zum Rüden sind extra neue gute Italienische Feigen, und große Meertrauchle mit und ohne Stiel, halbsinnig zum Abwenden, feine Chocolade, alles zu billigem Preis zu haben."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "20. Woselbst Sack neuer Walzen im billigen Preis, im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "21. Bey Hrn. Jacob Grimm nach dem Ried zu haben: Ein Kriegs-Atlas von 1689 des Landes Elsass, und 3 Theile der sogenannten Durchlaufenden Welt, 4. Theil mit Ausgaben. 4) Journal du camp de Compiegne avec le plan."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "22. Eine saubere französische Bether in ein Wirthshaus auf das Land oder in ein Bad dienlich unentgeltlich im Berichthaus zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "23. Eine Behausung in der Aescher Vorstadt mit 4 Stuben, 1 Kammer samt einer grossen Werkstatt, Estrig und einem schönen geräumigen Keller und Garten, weshalb sich der Hrn. Jacob Mäslin dem Weinmann anzumelden."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "24. Ein Freund, welcher circa 600 Ester Hanf-Samen anhero liefern könnte, möchte aber solchen vorhero verkauft wissen, offerirt selbigen zu haben im billigen Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "25. Wo guter alter weisser Wein zu haben, ist bey Wfr. Michael Fuchs dem Küfer zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "26. Circa 6. Saum extra guter alter rother Weissen-Wein, so gut als Neuenburger oder Burgunder, in billigem Preis, ist im Berichthaus zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "27. Zwey Stückleier weissen Wein von 1766, à 8 Pfund so ist der Saum im einen, und à 9 Pfund im andern, wovon nach Belieben zu haben; im Berichthause ohne Entgelt zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "28. Ein Stock Heu ab 3 Jahren Matten vorm Riecemer-Thor oberhalb der Schorenbrut. Ferner ein Stücklein von 7 Saumen rother Weingarten von 1760, schon verbrochen, alles im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "29. Auf der Kunst zum Bären sind wiederum 10 Saure Rüben im billigen Preis zu haben."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "30. Ein rothscharlachen Sammet und Hosen im billigen Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "31. Im Offenburger-Hof ist wohlgeordneter Bau zu haben."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "32. Ein Brennholzstadel bey der Steinen-Müslin ist zu vermiethen, im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "33. Zwey Fuder weisser und meiste Auggener-Wein, so in Fässern und Bottichen weger zu haben, im Berichthaus zu erfragen. Ferner 2 Fuder 1752ger Margrafer-Wein im billigen Preis zu haben, im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "34. Zwey beitergeleise hamburgischer Strick-Wolten zu 5 Pfund à 8 Sch., und wo selbige hinwiederum zu haben, im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "35. Ferner solgach des Siegfrieds Behausung ins Spiegelsässlein mit 4 Stuben, 3 Kammern zu vermiethen, oder samsthaft zu verkaufen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "36. Weisse und rothe Margrafer-Weine von 1760, worvon im billigen Preis nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "37. Ein Mannsrock St. Peters-Kirch auf dem Meret. Ferner ein grün Samtner Beinkleid mit grünem wollenen Umhängen, im billigen Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "38. Ein saubzistlicher extra schöner Bild und Kupferstich im billigen Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1793-06-20",
      "tags_section": null,
      "text": "39. Im Ziegelhofers-Hof auf St. Peter, mit Garten, Stallung, Keller &c. wie der Augenschein zeigen wird. In Ermangelung meldet sich der Kaiser."
    }
